import React from 'react';
import './Navbar.css';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate,
} from "react-router-dom";


const Navbar = () => {
  return (

      <ul>
        <li>
          <a>Home</a>
        </li>
        <li>
          <a>Movies</a>
        </li>
        <li>
          <a href="#">Most Popular</a>
        </li>
        <li>
          <a href="#">Top Airing</a>
        </li>
        <Navigate to="/" />
      </ul>

  );
};

export default Navbar;
